    visited = [[False] * m for _ in range(n)]
    for i in range(n):
        for j in range(m):
            if maze[i][j] == 'X':
                x, y = i, j
                maze[i][j] = '.'
    def is_valid(x, y):
        return 0 <= x < n and 0 <= y < m and not visited[x][y] and maze[x][y]!= '*'
    def dfs(x, y, path):
