                res = dfs(x + dx, y + dy, path)
                if res:
                    return res
                path.pop()
                visited[x + dx][y + dy] = False
        return None
    return ''.join(dfs(x, y, []) or 'IMPOSSIBLE' for x in range(n) for y in range(m))

