    graph = [[] for _ in range(N)]
    for _ in range(M):
        a, b, c = [int(x) for x in stdin.split()]
        graph[a - 1].append((b - 1, c))
        graph[b - 1].append((a - 1, c))

    # find all shortest paths
    distances = [None] * N
    distances[0] = 0
    for i in range(N):
        distances[i] = [float('inf')] * N
        distances[i][i] = 0
        for j in range(N):
            for k, v in graph[j]:
                if distances[i][k] is None or distances[i][k] > distances[i][j] + v:
                    distances[i][k] = distances[i][j] + v

    # find all edges that are not contained in any shortest path
    edges = 0
    for i in range(N):
        for j in range(i + 1, N):
            if distances[i][j] is None:
                edges += 1
    return str(edges)

