    def dfs(roads, visited, current, n, m):
        if current == n:
            return 0
        if visited[current]:
            return float('inf')
        visited[current] = True
        for i in range(m):
            if roads[i][0] == current:
                return dfs(roads, visited, roads[i][1], n, m) + 1
            if roads[i][1] == current:
                return dfs(roads, visited, roads[i][0], n, m) + 1
        return float('inf')

    visited = [False] * n
    min_controllers = float('inf')
    for i in range(n):
        if not visited[i]:
            min_controllers = min(min_controllers, dfs(roads, visited, i, n, m))

    if min_controllers == float('inf'):
        return 'IMPOSSIBLE'

    controllers = 0
    for i in range(n):
        if not visited[i]:
            controllers += 1
            visited[i] = True
            if controllers == min_controllers:
                break

    roads_to_reverse = []
    for i in range(m):
        if roads[i][0] == i:
            roads_to_reverse.append(roads[i][1])
        if roads[i][1] == i:
            roads_to_reverse.append(roads[i][0])
    roads_to_reverse.sort()

    return str(controllers) +'' +''.join(str(x) for x in roads_to_reverse)

