def solution(stdin: str) -> str:
    H, W = map(int, stdin.split())
    A = [list(map(int, stdin.split())) for _ in range(H)]
    B = [list(map(int, stdin.split())) for _ in range(H)]

    def is_valid(i, j):
        return 0 <= i < H and 0 <= j < W

    def paint(i, j, A, B):
        if is_valid(i, j):
            A[i][j] = 1
            B[i][j] = 0
        else:
            return False

    def travel(i, j, A, B):
        if is_valid(i, j):
            if A[i][j] == 1:
                A[i][j] = 0
                B[i][j] = 1
            else:
                A[i][j] = 1
                B[i][j] = 0
        else:
            return False

    def unbalancedness(A, B):
        return sum(sum(A), sum(B))

    def paint_and_travel(i, j, A, B):
        if paint(i, j, A, B):
            travel(i, j, A, B)

    def paint_and_travel_helper(i, j, A, B):
        if paint(i, j, A, B):
            travel(i, j, A, B)
            return unbalancedness(A, B)
        else:
            return float('inf')

    min_unbalancedness = float('inf')
    for i in range(H):
        for j in range(W):
            min_unbalancedness = min(min_unbalancedness, paint_and_travel_helper(i, j, A, B))

    return str(min_unbalancedness)

